import React from 'react';

function Library(props) {
    return (
        <tr>
            <th scope="row">{props.idx + 1}</th>
                <td>
                    {
                    (props.lib.type) === "js" ? <i class="fab fa-js-square"></i> : <i class="fab fa-node"></i>
                    }
                     {props.lib.name}
                    </td>
                <td><a href="https://animejs.com/">{props.lib.name}</a></td>
                <td>
                    <button class="btn btn-outline-primary btn-block" type="button" data-toggle="modal" data-target="#animeModal">
                    Pop up
                    </button>
                    </td>
                <td>
                    {
                        props.lib.tags.map(tag => {
                            return tag + " ";
                        })
                    }
                </td>
        </tr>
    );
}

export default Library;
